import React from "react";
import "./Weather.css";

function Weather() {
  return (
    <div className="Weather">
      <h1>Edmonton</h1>
      <ul>
        <li>Wednesday 14:00</li>
        <li>Clear Sky</li>
      </ul>
      <div className="row">
        <div className="col-6"></div>
      </div>
    </div>
  );
}
export default Weather;
